class CaixaService:
    def criar_caixa(self, nome: str, jogador_id: int) -> Caixa:
        if not nome or not nome.strip():
            raise ValueError("Nome vazio")
        if len(nome) > 20:
            raise ValueError("Nome muito longo")
        if not Jogador.query.get(jogador_id):
            raise ValueError("Jogador não existe")
        c = Caixa(nome=nome, jogador_id=jogador_id)
        db.session.add(c)

class EquipeService:
    def criar_equipe(self, jogador_id: int) -> Equipe:
        j = Jogador.query.get(jogador_id)
        if not j:
            raise ValueError("Jogador não existe")
        if j.equipe:
            raise ValueError("Já tem equipe")
        e = Equipe(jogador_id=jogador_id)
        db.session.add(e)
        db.session.commit()

class JogadorService:
    def criar_jogador(self, nome: str, idade: int) -> Jogador:
        if idade <= 0:
            raise ValueError("Idade inválida")
        if not nome or not nome.strip():
            raise ValueError("Nome vazio")
        j = Jogador(nome=nome, idade=idade)
        db.session.add(j)
        db.session.commit()
        return j

